from ml.datasets.hospital import HospitalHoloClean


def plot_list(ranges, list_series, list_names):
    fig = plt.figure()
    ax = plt.subplot(111)

    for i in range(len(list_series)):
        ax.plot(ranges[i], list_series[i], label=list_names[i])

    ax.set_ylabel('F-score')
    ax.set_xlabel('Number of rows to label')

    last = ranges[0][len(ranges[0])-1]
    baseline = 0.832
    baseline_reporter = 'HoloClean'

    ax.plot((0, last), (baseline, baseline), 'k-', color='orange')
    ax.text(last / 20, baseline - 0.05, r'baseline reported by ' + baseline_reporter, color='orange')

    ax.legend(loc=4)

    plt.show()

